	add("grievance", "{\"term\":\"grievance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027grievance\u0027 from the verb \u0027grever\u0027 (to irritate; to bother; to annoy) + \u0027-ance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something which causes grief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wrong or hardship suffered, which is the grounds of a complaint\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"November 2 2014\u0027\u0027, Daniel Taylor, \u0026quot;[http://www.theguardian.com/football/2014/nov/02/manchester-city-manchester-united-premier-league-match-report Sergio Agüero strike wins derby for Manchester City against 10-man United],\u0026quot; \u0027guardian.co.uk\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Wayne Rooney spent much of the game remonstrating with Oliver about his own \u0027\u0027grievances\u0027\u0027 and, in the interest of balance, there were certainly occasions when United had legitimate complaints\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A complaint or annoyance\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A formal complaint, especially in the context of a unionized workplace\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If you want the problem fixed, you\u0027ll have to file a \u0027\u0027grievance\u0027\u0027 with the city\", \"priority\":7}]}, \"synonyms\":{}}");

