	add("grinder", "{\"term\":\"grinder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|grind|er|lang\u003den}}{{etystub|en|where did sandwich sense come from}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who grinds something, such as the teeth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, A. J. Larner, \u0027A Dictionary of Neurological Signs\u0027 (page 68\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Masseter hypertrophy may become apparent in persistent \u0027\u0027grinders\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A molar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A power tool with a spinning abrasive disc, used for grin\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"grinding, smoothing, and shaping materials, usually metal\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sandwich made on a long, cylindrical roll\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I am going to the deli to get a \u0027\u0027grinder\u0027\u0027 for lunch\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A kitchen gadget for processing coffee, herbs etc. into small or powdered piece\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The restless flycatcher (\u0027Seisura inquieta\u0027) of Australia, which makes a noise like a scissors grinder\", \"priority\":10}]}, \"synonyms\":{}}");

