	add("griot", "{\"term\":\"griot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027griot\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A West African storyteller who passes on oral traditions; a wandering musician and poet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Françoise Pfaff, \u0027Sembene, A \u0027\u0027Griot\u0027\u0027 of Modern Times\u0027, in Michael T. Martin (editor), \u0027Cinemas of the Black Diaspora: Diversity, Dependence, and Oppositionality\u0027, griots%22+-intitle:griot|griots\u0026amp;hl\u003den\u0026amp;ei\u003dFE1aTtjQFcPFmAXprM2XDA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d10\u0026amp;ved\u003d0CFYQ6AEwC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"griots%22%20-intitle%3Agriot|griots\u0026amp;f\u003dfalse page 118\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Griots\u0027\u0027 may be the chroniclers of an important family or of a group of people — like the Bambara hunters’ \u0027\u0027griot\u0027\u0027 — or itinerant poets and musicians who extol the praises of the person who has hired them for a special festivity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Paul Stoller, \u0027Sensuous Scholarship\u0027, griots%22+-intitle:griot|griots\u0026amp;hl\u003den\u0026amp;ei\u003dSk9aTuqEKoadmQXrzLCsDA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CE8Q6AEwCDg\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"griots%22%20-intitle%3Agriot|griots\u0026amp;f\u003dfalse page 15\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When ethnographers are asked to read their works to gatherings of Songhay, elders, they, too, are considered \u0027\u0027griots\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Ethnographers, however, usually consider themselves scholars, not \u0027\u0027griots\u0027\u0027. They prepare themselves for their life\u0027s work in a manner altogether different from that of the \u0027\u0027griot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Melissa Thackway, \u0027Interview I: Adama Drabo, director\u0027, in \u0027Africa Shoots Back: Alternative Perspectives in Sub-Saharan Francophone African Film\u0027, griots%22+-intitle:griot|griots\u0026amp;hl\u003den\u0026amp;ei\u003dSk9aTuqEKoadmQXrzLCsDA\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDgQ6AEwAzg\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"griots%22%20-intitle%3Agriot|griots\u0026amp;f\u003dfalse page 183\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"I decided that it would be better for a \u0027\u0027griot\u0027\u0027 to take us back into the legend, rather than me, a contemporary man. \u0027\u0027Griots\u0027\u0027 have deeply marked me. I already narrated my first film, \u0027Ta Dona\u0027, in the same way that a \u0027\u0027griot\u0027\u0027 would have\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A Haitian dish of fried pork.Category:en:Musicians\", \"priority\":12}]}, \"synonyms\":{}}");

	add("griper", "{\"term\":\"griper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|gripe}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who gripe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An oppressor or extortione\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1601\u0027\u0027 December 1, w:John John Croke, speaking before Parliament, in [http://www.british-history.ac.uk/report.aspx?compid\u003d43558 Proceedings in the Commons, 1601], \u0027British History Online\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She did Accept of our intended Present, which (she said) manifested our Love and Loyalty; most graciously affirming, That She was never any greedy \u0027\u0027Griper\u0027\u0027, or fast Holder; and what We did present, She would not hoard up; but Our Eyes should see the Bestowing of it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"there wanted not those who condemned his pride and hypocrisy, knowing Pandulphus to be a most greedy \u0027\u0027griper\u0027\u0027, as appeared by his unconscionable oppression in the bishopric of Norwich, which was afterwards bestowed upon him\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Category:English agent nouns\", \"priority\":6}]}, \"synonyms\":{}}");

	add("gripper", "{\"term\":\"gripper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{-er|grip}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a person or thing that gri\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"grips somethin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a cover on the handle of a bicycle, tool, etc, that makes it easier to grip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A rubber or other material attached to a curling shoe to improve traction on the ic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a ticket collecto\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A visual component on a window etc. enabling it to be resized and/or moved\", \"priority\":6}]}, \"synonyms\":{}}");

	add("grippie", "{\"term\":\"grippie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|grip|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A grip; something used to take hold, or to reduce friction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Jeff Ishaq, \u0027Treo Fan Book: Your Brain on Silicon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Rubber \u0027\u0027grippies\u0027\u0027, partially visible on the right of the case above and below the hinge, keep it from sliding out of your hand\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Molly G. Shane, \u0027Rumored Legacy\u0027 (page 62\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I crocheted chenille socks and put little \u0027\u0027grippies\u0027\u0027 on the bottom\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Joseph Labrecque, \u0027Adobe Edge Quickstart Guide\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"To tear a panel out of the main application window and create a floating panel, simply click upon the \u0027\u0027grippies\u0027\u0027 (the textured area of the panel tab) next to an anchored panel\u0027s name\", \"priority\":7}]}, \"synonyms\":{}}");

	add("grisaille", "{\"term\":\"grisaille\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}. French|grisaille\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In painting, a method of working which employs only varying values of gray to create form. Often a preliminary step in a fully colored painting\", \"priority\":1}]}, \"synonyms\":{}}");

	add("grisette", "{\"term\":\"grisette\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027grisette\u0027 from \u0027gris\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A French girl or young married woman of the lower class; especially, a young working-class woman of perceived easy morals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1842\u0027\u0027, ‘The Mystery of Marie Rogêt’\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The anticipations of the shopkeeper were realized, and his rooms soon became notorious through the charms of the sprightly \u0027\u0027\u0027grisette\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Sebastian\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 1015\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"he enjoyed the immense luxury not only of lovemaking but also of sleeping and drowsing beside this gentle and composed and somewhat melancholy woman, who was not a \u0027fille de joie\u0027 in the professional sense but more like a \u0027\u0027\u0027grisette\", \"priority\":5}]}, \"synonyms\":{}}");

	add("gristle", "{\"term\":\"gristle\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"old frisian\"], \"text\":\"From Middle english (1100-1500) \u0027gristel\u0027 \u0027grystyl\u0027 from Old english (ca. 450-1100) \u0027gristel\u0027 \u0027gristle\u0027 (gristle, cartilage) formed from a diminutive of Old english (ca. 450-1100) \u0027grist\u0027 (a grinding) from Proto-germanic {{m|gem-pro|*gredaną||to crunch}}, equivalent to {{suffix|grist|le|lang\u003den}}. Cognate with Old frisian \u0027gristel\u0027 \u0027gerstel\u0027 (gristle, cartilage) Middle low german \u0027gristel\u0027 (gristle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cartilage; cartilage present, as a tough substance, in meat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"When you\u0027re chewing on life\u0027s \u0027\u0027gristle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t grumble, give a whistl\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And this\u0027ll help things turn out for the best\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Bone not yet hardened by age and hard work\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, Herman Melville, s:Redburn. His First Voyage/Chapter Redburn. His First Voyage\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And it is a hard and cruel thing thus in early youth to taste beforehand the pangs which should be reserved for the stout time of manhood, when the \u0027\u0027gristle\u0027\u0027 has become bone, and we stand up and fight out our lives, as a thing tried before and foreseen; for then we are veterans used to sieges and battles, and not green recruits, recoiling at the first shock of the encounter\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1859\u0027\u0027, George Eliot, s:Adam Bede/Chapter Adam Bede\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Look at Adam through the rest of the day, as he stands on the scaffolding with the two-feet ruler in his hand, whistling low while he considers how a difficulty about a floor-joist or a window-frame is to be overcome; or as he pushes one of the younger workmen aside and takes his place in upheaving a weight of timber, saying, \u0026quot;Let alone, lad! Thee\u0027st got too much \u0027\u0027gristle\u0027\u0027 i\u0027 thy bones yet\u0026quot;; or as he fixes his keen black eyes on the motions of a workman on the other side of the room and warns him that his distances are not right\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, Ada Sarah Ballin, s:Science of The Science of Dress in Theory and Practice\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It. must be borne in mind that the bones of a young infant are little more than \u0027\u0027gristle\u0027\u0027, and are liable to bend, and so become deformed\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1896\u0027\u0027, Arthur Conan Doyle, s:Rodney Stone/Chapter Rodney Stone\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"quot;The young \u0027un will make his way,\u0026quot; said Belcher, who had come across to us. \u0026quot;He\u0027s more a sparrer than a fighter just at present, but when his \u0027\u0027gristle\u0027\u0027 sets he\u0027ll take on anything on the list\", \"priority\":13}]}, \"synonyms\":{}}");

	add("grith", "{\"term\":\"grith\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old norse\"], \"text\":\"Late Old english (ca. 450-1100) \u0027grið\u0027, from Old norse \u0027grið\u0027 \u0026quot;domicile, home\u0026quot;, in the plural with a meaning \u0026quot;truce, peace; sanctuary, asylum\u0026quot;.The English word is attested from the early 11th century, and after the end of the Anglo-Saxon period assumed a meaning of peace in general, especially by association with \u0027frith\u0027. The word became obsolete by the 16th century, or during the 17th century in Scottish English, but was revived in the context of historical novels in the 19th century.The verb \u0027griðian\u0027 \u0026quot;to make peace\u0026quot; appears in the Laws of Æthelred (\u0027Þæt hi Godes cirican æȝhwar ȝeorne griðian and friðian\u0027) and in Middle English is attested occasionally during the 13th century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"guaranteed security, sanctuary, safe conduc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"security, peace or protection guaranteed in particular instances in Old English law\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a place of protection, a sanctuary\", \"priority\":3}]}, \"synonyms\":{}}");

